import React from 'react';
import ReactDOM from 'react-dom/client';
import "./index.css";

function App(){
  return(
    <main className='card'>
      <h1>Hello</h1>
      <Image />
      <Content />
      <Buttons name="HTML" color="red"/>
      <Buttons name="CSS" color="blue"/>
      <Buttons name="JavaScript" color="yellow"/>
    </main>
  )
}

function Image(){
  return(
    <img src='new.jpg'></img>
  )
}

function Content(){
  return(
    <p>This is the content of the file.</p>
  )
}

function Buttons(props){
  return(
    <div>
      <button>{props.name}</button>
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
